import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from './Components/NavBar';

function App() {
  return (
    <div style={{backgroundColor: '#6c757d'}}>
      <NavBar />
      <div style={{marginLeft: '20%', marginRight: '20%', backgroundColor: 'white', borderRadius: '2%'}}>
        <li>ddgddf</li>
        <li>fbdbd</li>
        <li>bdfbdbfd</li>
        <li>bbdfbdb</li>
        <li>uhbj</li>
      </div>
    </div>
  );
}

export default App;
